import React, { useState, useEffect } from 'react';
import './index.css';

function App() {
  const [userName, setUserName] = useState('');
  const [namMember, setNamMember] = useState([]);
  const [lstMember, setLstMember] = useState([]);
  const [parent, setParent] = useState([]);
  const [equal, setEqual] = useState([]);
  const [currentIndices, setCurrentIndices] = useState({ cmp1: 0, cmp2: 1 });
  const [isSorting, setIsSorting] = useState(false);
  const [showResults, setShowResults] = useState(false);

  useEffect(() => {
    fetch('options.txt')
      .then(response => response.text())
      .then(data => {
        const optionsArray = data.split('\n').filter(option => option.trim() !== '');
        setNamMember(optionsArray);
        if (optionsArray.length > 1) {
          initList(optionsArray);
        } else {
          console.error('Insufficient options to perform sorting.');
        }
      })
      .catch(error => console.error('Error loading options:', error));
  }, []);

  const initList = (optionsArray) => {
    const list = [...optionsArray.keys()].map(() => []);
    const parentArray = Array(optionsArray.length).fill(-1);
    const equalArray = Array(optionsArray.length).fill(-1);
    setLstMember(list);
    setParent(parentArray);
    setEqual(equalArray);
  };

  const handleStart = () => {
    if (userName.trim() === '') {
      alert('Please enter your name to start the quiz.');
      return;
    }
    setIsSorting(true);
  };

  const handleChoice = (choice) => {
    const { cmp1, cmp2 } = currentIndices;
    if (choice === 'left') {
      lstMember[cmp1].push(namMember[cmp2]);
    } else if (choice === 'right') {
      lstMember[cmp2].push(namMember[cmp1]);
    } else if (choice === 'both') {
      equal[cmp1] = cmp2;
    }

    if (cmp2 + 1 < namMember.length) {
      setCurrentIndices({ cmp1: cmp1 + 1, cmp2: cmp2 + 1 });
    } else {
      setIsSorting(false);
      setShowResults(true);
    }
  };

  const handleRedo = () => {
    setCurrentIndices({ cmp1: 0, cmp2: 1 });
    setIsSorting(false);
    setShowResults(false);
  };

  return (
    <div className="App">
      <header className="App-header">
        <h1>Help Me Name My Cat!</h1>
        <p>Welcome to the ultimate cat name sorter! Please help me decide on the perfect name by choosing your favorite option in each matchup.</p>
      </header>
      {!isSorting && !showResults && (
        <div className="user-input">
          <label htmlFor="userName">Enter your name:</label>
          <input type="text" id="userName" value={userName} onChange={(e) => setUserName(e.target.value)} placeholder="Your Name" required />
          <button onClick={handleStart}>Start Sorting</button>
        </div>
      )}
      {isSorting && (
        <div className="quiz-section">
          <h2>Matchup</h2>
          <div className="matchup">
            <button onClick={() => handleChoice('left')}>{namMember[currentIndices.cmp1]}</button>
            <div className="middleField">
              <button onClick={() => handleChoice('both')}>I like both</button>
              <button onClick={() => handleChoice('none')}>No Opinion</button>
            </div>
            <button onClick={() => handleChoice('right')}>{namMember[currentIndices.cmp2]}</button>
          </div>
        </div>
      )}
      {showResults && (
        <div className="results-section">
          <h2>Results</h2>
          <ul>
            {lstMember.map((list, index) => (
              <li key={index}>{namMember[index]}: {list.join(', ')}</li>
            ))}
          </ul>
          <button onClick={handleRedo}>Redo Bracket</button>
        </div>
      )}
      <footer>
        <p>Made with ❤️ by a fellow cat lover</p>
      </footer>
    </div>
  );
}

export default App;
